import Link from 'next/link';
import NavSide from 'components/site/layout/NavSide';

// <NavItem data={route} key={index} />
export default ({ routes = [] }) => {
  return (
    <nav>
      <NavSide side="left"></NavSide>
      <NavSide side="right">
        {routes.map((route, index) => (
          <div>{route.name}</div>
        ))}
      </NavSide>
    </nav>
  );
};
